"original": |2-
     The "bytes" range unit is used to express subranges of a
     representation data's octet sequence.  Each byte range is expressed
     as an integer range at some offset, relative to either the beginning
     (int-range) or end (suffix-range) of the representation data.  Byte
     ranges do not use the other-range specifier.
"fixed": |-
  The "bytes" range unit is used to express subranges of a representation data's octet sequence.  Each byte range is expressed as an integer range at some offset, relative to either the beginning (int-range) or end (suffix-range) of the representation data.  Byte ranges do not use the other-range specifier.
"ko": |-
  "바이트" 범위 단위는 표현 데이터의 옥텟 시퀀스의 하위 범위를 표현하는 데 사용됩니다. 각 바이트 범위는 표현 데이터의 시작(int-range) 또는 끝(suffix-range)을 기준으로 일부 오프셋에서 정수 범위로 표현됩니다. 바이트 범위는 other-range 지정자를 사용하지 않습니다.
